import React, { Component } from 'react';
import './MyJobs.css';





class MyJobs extends Component {
  render() {
    return (      

      <div className="header-div">
      <HeaderJobs goToHome={this.goHome} goToMyJobs={this.goMyJobs}  page={"home"} myJobCount={this.state.jobCount}/>
      </div>


   );
  }
}

export default MyJobs;
